description:
David. // is a game. A game about physics and enemies. A game about struggles and life. A game about David.

You play David, an awfully small abstracted chosen hero tossed into a blissfully simple world overrun by giant culminations of evil physics-beasts. 

As David, you are given a slingshot-esque gift that you will have to use to conquer your colossus foes. Hold, aim, and fling to attack.

